import Rust from '../components/rust'
import Game from '../components/game'

const Index = () => {

  return (
    <>
      <div className="container">
        <Game />
      </div>

      <style jsx>
        {`
        .container {
          display: flex;
          flex-direction: column;
          align-items: center;
          margin-top: 10vh;
          padding: 5rem;
        }
      `}
      </style>
    </>
  )
}

export default Index
